	return (
     <div className = 'center' >
      <div className = 'absolute  mt2' >
	     <img id='inputImage' src = {imageUrl} alt = '' width = '700px' height = 'auto'/>
	  </div>
	  <div className = 'bounding-box'></div>
	 </div>


	);
}

export default FaceRecognition;
